    def is_sorted(s: str, mapping: dict[int, str]) -> bool:
        """
        A string is sorted if the characters can be sorted in the order they appear in the string.
        """
        for i in range(len(s) - 1):
            if mapping[i] > mapping[i + 1]:
                return False
        return True

    def swap_position(s: str, mapping: dict[int, str], i: int, j: int) -> None:
        """
        Swaps characters in $s$ such that mapping[i] < mapping[j]
        """
        mapping[i], mapping[j] = mapping[j], mapping[i]

    def color_sorted_string(s: str, mapping: dict[int, str]) -> str:
        """
        Returns coloring of the string $s$ in the form "0" if the given coloring is sorted,
        "1" otherwise.
        """
        coloring = ""
        for i, c in enumerate(s):
            if mapping[i] == c:
                coloring += "0"
            else:
                coloring += "1"
        return coloring

    def make_mapping(s: str) -> dict[int, str]:
        """
        Returns a dictionary whose keys are the indices of the characters in $s$ and the values are the characters.
        """
        mapping = {}
        for i, c in enumerate(s):
            mapping[i] = c
        return mapping

    def make_colored_string(s: str) -> str:
        """
        Returns a string consisting of "0"s and "1"s, where the $i$-th character is '0' if the $i$-th character is colored the first color,
        "1" otherwise.
        """
        mapping = make_mapping(s)
        coloring = color_sorted_string(s, mapping)
        return coloring

    # A coloring can be done if and only if all characters are colored different, and the coloring is sorted.
    if is_sorted(s, make_mapping(s)):
        print("YES")
        print(make_colored_string(s))
    else:
