    def get_road_nodes(river: list[int]) -> tuple[int, int]:
        start, end = 0, 0
        for i, length in enumerate(river):
            if i % 2 == 0:
                start += length
            else:
                end += length
        return start, end

    def is_jumping_possible(n: int, m: int, d: int, river: list[int], trees: list[int]) -> bool:
        start, end = get_road_nodes(river)
        if start > n or end < 0:
            return False

        left, right = 0, 0
        for i, tree in enumerate(trees):
            if i % 2 == 0:
                left += tree
            else:
                right += tree
            if left > right:
                return False

        left_start, left_end = get_road_nodes(left)
        right_start, right_end = get_road_nodes(right)
        if right_start > n or left_end < 0 or left_end < left_start:
            return False

        result = [1] * n
        result[left_start: left_end + 1] = [2] * (left_end - left_start + 1)
        result[right_start: right_end + 1] = [3] * (right_end - right_start + 1)
        return result

    n, m, d = list(map(int, stdin.split()))
    trees = list(map(int, stdin.split()))
    if len(trees) > n:
        return 'NO'

    result = is_jumping_possible(n, m, d, [0] + trees, trees)
    if result is False:
        return 'NO'

    return 'YES'

