    n, m = map(int, stdin.split())
    edges = [(u, v) for u, v in map(int, stdin.split()) if 1 <= u <= n and 1 <= v <= n]
    if len(edges) < n:
        return "NO"
    if len(edges) == n:
        return "YES"
    # the graph is connected if and only if every pair of vertices in it
    # is connected
    visited = [False] * n
    for u, v in edges:
        visited[u-1] = True
        visited[v-1] = True
    # depth first search, keep track of which edges we've seen
    def dfs(v: int, prev: int) -> str:
        if visited[v]:
            return "0"
        visited[v] = True
        for u, v in edges:
            if u == v:
                continue
            if u == prev:
                return "1" + dfs(v, u)
            if v == prev:
                return "0" + dfs(u, v)
        return "0"
    return dfs(0, -1)

