        if min > max:
            return False, 0

        if min == max:
            return True, min

        mid = (min + max) // 2
        left, left_max = find(sticks, min, mid - 1)
        right, right_max = find(sticks, mid + 1, max)

        if left and right:
            return True, mid
        if left and not right:
            return left, left_max
        if not left and right:
            return right, right_max

        return False, 0

    result, _ = find(sticks, 0, 4 * n - 1)
    if result:
        return "YES"
    else:
        return "NO"

