    indices = [[[i,j] for j in range(N)] for i in range(M)]


    for i in range(M):
        for j in range(N):
            if i==0:
                indices[i][j] = [[i+1,j],[i,j+1]]
            elif j==0:
                indices[i][j] = [[i-1,j],[i,j+1]]
            elif i==M-1:
                indices[i][j] = [[i-1,j],[i,j-1]]
            else:
                indices[i][j] = [[i+1,j],[i-1,j],[i,j+1],[i,j-1]]


    #second pass, calculate the actual shortest path
    #we'll store our path as an array of arrays
    #path[i][j] will hold the path to get from indices[0][0] to indices[i][j]
    path = [ [ [0]*2 for j in range(N)] for i in range(M)]

    def findPath(a: int, b: int) -> int:

        if b<0 or b>=N or a<0 or a>=M:
            return 0

        if a==0 and b==0:
            return 0

        #paths to a[0][0] and b[0][0]
        #are all zero, as the path starts at the start of a and b
        if a==0:
            if b==0:
                return 0
            return 1 + findPath(a,b-1)

        if b==0:
            return 1 + findPath(a-1,b)

        #the actual algorithm is now to check every subarray and return the smallest

        left = findPath(a-1,b)
        up = findPath(a,b-1)
        diag = findPath(a-1,b-1)

        #if we are here, we know that the path that starts at a[0][0] is [0]
        #and that starts at b[0][0] is [1]

