        #in the previous line, we have to return two paths
        #now, we just have to choose the smallest one
        #since all the other options would be worse, we return the minimum
        if left<up:
            if left<diag:
                return left
            else:
                return diag
        else:
            if up<diag:
                return up
            else:
                return diag


    #now we find the paths, calculate the actual path length
    #and return the sum
    return findPath(M-1,N-1)

