    def border(r, c, direction):
        if direction == 'L':
            if c == 0:
                return True
            return grid[r][c - 1]!= '1'
        if direction == 'R':
            if c == len(grid[0]) - 1:
                return True
            return grid[r][c + 1]!= '1'
        if direction == 'U':
            if r == 0:
                return True
            return grid[r - 1][c]!= '1'
        if direction == 'D':
            if r == len(grid) - 1:
                return True
            return grid[r + 1][c]!= '1'

    def find_start(r, c):
        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if grid[i][j] == 'S':
                    r, c = i, j
                    return r, c

    def bfs(r, c, visited):
        queue = [(r, c)]
        visited[r][c] = True

        while queue:
            r, c = queue.pop(0)

            if r == len(grid) - 1 and c == len(grid[0]) - 1:
                return True

            for d in ['U', 'D', 'L', 'R']:
                if border(r, c, d) and not visited[r][c]:
                    visited[r][c] = True
                    queue.append((r, c))
        return False

    start_r, start_c = find_start(0, 0)

    return 'NOT POSSIBLE' if start_r == len(grid) - 1 and start_c == len(grid[0]) - 1 else str(bfs(start_r, start_c, visited))

