        dist[0][0] = 0
        while q:
            c = q.popleft()
            for r, c in c:
                for dr, dc in [(2, 1), (2, -1), (-2, 1), (-2, -1), (1, 2), (1, -2), (-1, 2), (-1, -2)]:
                    nr, nc = r + dr, c + dc
                    if (nr, nc) in s and dist[nr][nc] == -1:
                        dist[nr][nc] = dist[r][c] + 1
                        q.append((set((nr, nc)),))
        return dist[N - 1][N - 1]

